import React from 'react'
import {Navbar,Hero,Card} from './Components/Component'

const App = () => {
  return (
    <section className='container'>
      <Navbar />
      <Hero />
      <div>
        <Card 
        img="/image12.png"
        rate={5.0}
        place="USA"
        title="Life Lessons with Katie Zaferes"
        price={136}
        />
      </div>
    </section>
  )
}

export default App
